import { findAllByTitle } from "react-testing-library";

export const ADD_TODO = "ADD_TODO";
export const TODO_TOGGLED = "TODO_TOGGLED";

export const add = (title) => {
  return {
    type: ADD_TODO,
    payload: title,
  };
};
